import React from "react";

const colors = [
  {
    id: "1",
    code: "cadetblue",
    name: "Cadet Blue",
  },
  {
    id: "2",
    code: "green",
    name: "Green",
  },
  {
    id: "3",
    code: "red",
    name: "Red",
  },
  {
    id: "4",
    code: "orange",
    name: "Orange",
  },
  {
    id: "5",
    code: "blue",
    name: "Blue",
  },
  {
    id: "6",
    code: "black",
    name: "Black",
  },
];

const DarkLight = () => {
  return (
    <div className="row">
      <div className="col-md-12  d-flex  justify-content-center text-white  align-items-center">
        <button className="btn btn-basic">Light</button>
        <button className="btn btn-basic">Dark</button>
      </div>
    </div>
  );
};

export default DarkLight;
